import { Button } from '../../globalStyles'
import * as s from './News.styling'


export const NewsItem = (props) => {
    return (
        <s.NewsCartWrap>
            <img src={props.imageUrl} />
            <h4>{props.title}</h4>
            <Button to="/" fontBig orange>Read full article</Button>
        </s.NewsCartWrap>
    )
}
